import React, { useState, useContext } from "react";
import { instance1 } from "../../../api/axios";
import Mensagem from "../../layout/hooks/Mensagem";
import useMensagem from "../../layout/hooks/useMensagem";
import ModalPdf from "../../../components/ModalPdf";
import { AuthContext } from "../../../components/AuthContext";
import pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from "pdfmake/build/vfs_fonts";

export default function PdfRelatorioEmpregabilidade() {
    pdfMake.vfs = pdfFonts.default.vfs;
    const [nome, setNome] = useState("");
    const [cpf, setCpf] = useState("");
    const [contato, setContato] = useState("");
    const [areaAtuacao, setAreaAtuacao] = useState("");
    const [departamento, setDepartamento] = useState("");
    const [status, setStatus] = useState("");
    const { successMessage, errorMessage, warningMessage, showSuccessMessage, showErrorMessage, showWarningMessage } = useMensagem();
    const [isModalPdfOpen, setIsModalPdfOpen] = useState(false);

    const { user } = useContext(AuthContext); // Acessa o nome do usuário do contexto
    const currentDate = new Date().toLocaleDateString(); // Data atual

    const generatePdf = async () => {
        try {
            const response = await instance1.get(`/relatorioEmpregabilidade`, {
                params: {
                    nome,
                    contato,
                    areaAtuacao,
                    departamento,
                    status
                },
            });
            console.log("Relatorio", response)

            const data = response.data;
            if (!data || data.length === 0) {
                showWarningMessage(response.data.message || "Nenhum dado disponível para gerar o relatório");
                return;
            }

            const reportTitle = {
                table: {
                    widths: ["100%"], // Define as proporções das colunas
                    body: [
                        [
                            {
                                stack: [
                                    {
                                        table: {
                                            widths: ["30%", "70%"], // Ajuste conforme necessário
                                            body: [
                                                [
                                                    {
                                                        image: `data:image/png;base64,`,
                                                        width: 180, // Ajuste conforme necessário
                                                        alignment: "left",
                                                        margin: [5, 0, 0, 0] // Espaço abaixo da logo
                                                    },
                                                    {
                                                        stack: [
                                                            {
                                                                text: "RELATÓRIO CANDIDATOS",
                                                                style: "title",
                                                                bold: true,
                                                                alignment: "left",
                                                                decoration: "underline"
                                                            },
                                                        ]
                                                    }
                                                ]
                                            ]
                                        },
                                        layout: "noBorders" // Remove as bordas da tabela interna
                                    }
                                ],
                                border: [false, false, false, false]
                            }
                        ]
                    ]
                },
                layout: {
                    hLineWidth: function (i, node) {
                        return 1; // Espessura da linha horizontal
                    },
                    vLineWidth: function (i, node) {
                        return 1; // Espessura da linha vertical
                    }
                },
                margin: [10, 10, 10, 0] // Margem inferior para separar do próximo conteúdo
            };

            const candidatosTableBody = [
                [
                    { text: "Nome", bold: true },
                    { text: "Contato", bold: true },
                    { text: "Área de Atuação", bold: true },
                    { text: "Departamento", bold: true },
                    { text: "Status", bold: true },
                ],
            ];
            
            data.forEach((candidato, index) => {
                candidatosTableBody.push([
                    { text: candidato.nome || "N/A", fillColor: index % 2 === 0 ? "#ADADAD" : null },
                    { text: candidato.contato || "N/A", fillColor: index % 2 === 0 ? "#ADADAD" : null },
                    { text: candidato.areaAtuacao || "N/A", fillColor: index % 2 === 0 ? "#ADADAD" : null },
                    { text: candidato.departamento || "N/A", fillColor: index % 2 === 0 ? "#ADADAD" : null },
                    { text: candidato.status || "N/A", fillColor: index % 2 === 0 ? "#ADADAD" : null }
                ]);
            });

            const details = [
                { text: `Usúario: ${user.nome}`, style: "info" },  // Nome do usuário
                { text: `Impressão do dia: ${currentDate}`, style: "info" },  // Nome do usuário
                {
                    table: {
                        widths: ["35%", "18%", "20%", "auto", "13%"],
                        body: candidatosTableBody,
                    }
                }
            ]

            const documentDefinition = {
                header: [reportTitle],
                content: [details],
                styles: {
                    title: {
                        fontSize: 28,
                        margin: [10, 13, 10, 0],
                        bold: true,
                        alignment: "center",
                    },
                },
                defaultStyle: {
                    fontSize: 10,
                },
                pageSize: "A4",
                pageOrientation: "landscape", // Adicione esta linha para deixar o PDF na horizontal
                pageMargins: [30, 80, 10, 10],
            };            

            pdfMake.createPdf(documentDefinition).download("Relatorio_Candidatos.pdf");
            setIsModalPdfOpen(false);
            setAreaAtuacao("");
            setStatus("");
        } catch (error) {
            console.error("Erro ao gerar o PDF", error);
            showErrorMessage(error.response?.data?.message || "Erro ao gerar o PDF");
        }
    };

    return (
        <div>
            <button
                onClick={() => setIsModalPdfOpen(true)}
                className="bg-green-900 text-white py-0.5 px-16 mt-1 ml-2 rounded hover:bg-green-950 transition duration-300"
            >
                Relatório
            </button>

            <ModalPdf
                isOpen={isModalPdfOpen}
                onClose={() => setIsModalPdfOpen(false)}
                onSubmit={generatePdf}
            >
                <h2 className="bold text-lg mb-4">Relatorio Candidatos:</h2>
                {/* Campo de descrição e inputs organizados em 3 colunas */}
                <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                    <div>
                        <label htmlFor="areaAtuacao" className="block mb-1 text-black">Área de Atuação:</label>
                        <input
                            type="text"
                            id="areaAtuacao"
                            value={areaAtuacao}
                            onChange={(e) => setAreaAtuacao(e.target.value)}
                            className="border p-2 w-full"
                        />
                    </div>
                    <div>
                        <label htmlFor="status" className="block mb-1 text-black">Status:</label>
                        <input
                            type="text"
                            id="status"
                            value={status}
                            onChange={(e) => setStatus(e.target.value)}
                            className="border p-2 w-full"
                        />
                    </div>
                </div>
            </ModalPdf>
            <Mensagem successMessage={successMessage} errorMessage={errorMessage} warningMessage={warningMessage} />
        </div>
    );
}
